import React from 'react'
import all_product from '../components/assets/all_product'
import { useParams } from 'react-router-dom'

export const Product = () => {
  return (
    <div>
    const k = {useParams()}
    const product = {all_product.find((e)=>{
      e.id === Number(k.ProductId)
    })}
    </div>
  )
}
